class AddItem extends React.Component{

    render(){
        return (<form id = "add-item">
            <input id  = "toadd"></input>
            <input type = "submit" onClick = {() => this.props.handleAdd(
                document.getElementById("toadd").value
            )}></input>
        </form>)
    }
}

export default AddItem
